import React from "react";
import { StyledHome } from "./Home.styled";
import TypeIt from "typeit-react";


const Home = () => {
  return (
    <StyledHome>
      <p>Hi, my name is</p>
      <h1>Shorya Khanna.</h1>
      <h2 className="Home">
        <TypeIt
          getBeforeInit={(instance) => {
            instance
              .type("I'm a developer", { delay: 300 })
              // .move(-3)
              .pause(300)
              .delete(9)
              .type("designer")
              // .move("END")
              .pause(300)
              .type(" let yees")
              .delete(2)
              .type("sterday use up to muc")
              .move(-4)
              .type("o")
              .move("END")
              .type("h of today.")
              .pause(500)
              .break({ delay: 500 })
              .break({ delay: 500 })
              .type("<em>- Will Rogers</em>")
              .go();
            // Remember to return it!
            return instance;
          }}
        />

      </h2>
    </StyledHome>
  );
};

export default Home;
